import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Navbar from './Components/Navbar';
import Register from './Components/Register';

function App() {
  return (
    <div className="App">
      <Navbar />

      <Router>
        <Route component={Register} path='/register'/>
      </Router>
    </div>
  );
}

export default App;
